// For each found, evaluate the condition
// If it passes, add to the data.buttonsvar actionQuery = new GlideRecord(‘u_portal_actions’);
actionQuery.addQuery(‘u_ticket_table’,data.table);
actionQuery.query();while (actionQuery.next()) { if (GlideFilter.checkRecord(gr, actionQuery.u_conditions.getValue())) { var actionButton = { name: actionQuery.u_name.getValue(), label: actionQuery.u_label.getValue(), condition: actionQuery.u_conditions.getValue(), text: actionQuery.u_modal_text.getValue(), commentsVisible: (actionQuery.u_comments_box_visible.getValue() == ‘1’), commentsMandatory: (actionQuery.u_comments_box_mandatory.getValue() == ‘1’), sysId: actionQuery.sys_id.getValue() }; data.buttons.push(actionButton); }
} So this is pretty simple. We’re querying for everything on the Portal UI Actions table that matches the table our ticket is on. For each, if it passes the GlideFilter.checkRecord check, which tests a record (in our case, ours) against a query (in our case, the 'u_conditions' field), we set our actionButton object and push it into data.buttons. Simple! Oh, and what’s going on with u_comments_box_visible and u_comments_box_mandatory ? Well, true and false checkboxes provide 1s and 0s… as strings, as far as I can tell. So we can’t just ask if the values are true or false; they’ll always be true, even if they’re '0', because '0' is a string and therefore true. Now that we’ve got our buttons, we can also amend that UI Actions visibility section. Last time, we were checking through the array for the conditions. We’ve already done that, though! Let’s just check the length of the data.buttons array. // This section sets the entire visibility of the UI Actions panel,
