2 March 2023 A happy number is a number defined as follows: Starting with any positive integer, replace the number by the sum of its squares of its digits, and repeat the process until the number equals 1. If the number is a happy number, it will resolve to 1. If it is a sad number, it will loop endlessly. Let’s get the first 10,000 happy numbers! // INSTANTIATE OUR SETS
// WE KNOW 1 IS A HAPPY NUMBER BY DEFINITION
let happyNumbers = new Set([1]);
let sadNumbers = new Set(); // GET FIRST 10,000 HAPPY NUMBERS
for (x = 0; happyNumbers.size < 10000; x++) { getHappyNumber(x);
} // RESULT OUTPUT
var finalArray = Array.from(happyNumbers).sort( (a, b) => a - b);
console.log("Happy Numbers: " + finalArray.join(', ')); function getHappyNumber(input) { // HOLDING ARRAY WILL LET US KEEP TRACK OF CALCULATED SUMS OF SQUARED DIGITS let holdingArray = []; while (true) { // IF HAPPY NUMBER ALREADY HAS IT // NO NEED TO RECALCULATE, PUSH TO SET OF HAPPY NUMBERS if (happyNumbers.has(input)) { holdingArray.forEach(x => happyNumbers.add(x)); break; // IF WE ARE IN A LOOP OR SAD NUMBER ALREADY HAS IT // NO NEED TO RECALCULATE, PUSH TO SET OF SAD NUMBERS } else if (sadNumbers.has(input) || holdingArray.includes(input)) { holdingArray.forEach(x => sadNumbers.add(x)); break; } // PUSH THE NUMBER TO THE HOLDING ARRAY holdingArray.push(input); // CALCULATE SUM OF SQUARES // GOTTA TURN THIS NUMBER INTO A STRING // AND THEN SPLIT IT INTO AN ARRAY // AND SUM UP EACH SQUARED VALUE WITH REDUCE input = input.toString().split('').reduce( (acc, cur) => acc + (cur ** 2), 0 ); } } Time to break this bad boy down.

