The Server Script presets some modal form values for data.commentsVisible and data.commentsMandatory to use later—in some cases, we want users to be able to input comments, and in some cases enforce comments to be inputted, before allowing the action to continue. We also initialize buttonValues. We then fetch data.table and data.sys_id as the input.table and input.sys_id. So this looks like: // Preset some modal form values related to the comments visibility.
// In some cases, we may not need a UI Action to have a comments box.
