// name: give it a single word name.
// label: This will be the button label and modal header.
// condition: The condition for the button to show up.
// text: The supporting text on the modal window.
// commentsVisible: Whether there should be an input comments window.
// commentsMandatory: Whether the comments window should be mandatory.
// execution: The function to execute when clicked on.// Remember! gr is the variable for the current record.
data.buttons = [{name:'reopenRslv', label: 'Reopen Resolved Incident', condition: (data.table == 'incident' && gr.incident_state == 6 && gr.caller_id == gs.getUserID()), text: "Please enter a comment when reopening an Incident.", commentsVisible: true, commentsMandatory: true, execution: function(){ gr.state = 60; gr.close_code = ''; gr.close_notes = ''; gr.comments = input.comments; gr.update(); } }
] Notice how we gave the name of the button, the user-friendly label, the text to show the user, the condition to show this button on (which must include the ticket table to show this button on), set our commentsVisible and commentsMandatory, and set our execution script. You can also set data.referURL within the execution function, by the way. This will be handled later, and is useful for actions that generate new tickets from the existing ticket — you can forward your user directly to the new ticket. We then decide whether to show the Portal UI Actions panel at all: // This section sets the entire visibility of the UI Actions panel,
// based on whether any of the button conditions evaluate to true.var arrayLength = data.buttons.length; var flag = false; for (var i=0; i < arrayLength; i++) { if (data.buttons[i].condition == true) { flag = true; } } data.panelVisibility = flag; We now handle how the modal window will look and act, by checking if input.button occurred. // Handle the modal title and additional fields.
// Also handle whether comments need to be visible and mandatory.
// This works by finding the data.buttons object corresponding to the button clicked.if (input && input.button) { var button = input.button;buttonValues = findButton(data.buttons, 'name', button); data.title = buttonValues.label; data.text = buttonValues.text; data.commentsVisible = buttonValues.commentsVisible; data.commentsMandatory = buttonValues.commentsMandatory; } findButton looks like the below — we are sending along the data.buttons array, ‘name’, and the actual name of the button they clicked on. Essentially we look for which button the user clicked on and return that one, which will display the modal window for the user. // Function to find the correct button in the buttons data function findButton(array, key, value) { for (var i = 0; i < array.length; i++) { if (array[i][key] === value) { return array[i]; } } return null; } Finally, when the user clicks Submit on the modal window, we find the correct execution action and execute it: if (input && input.action) { var action = input.action; buttonValues = findButton(data.buttons, 'name', action); buttonValues.execution();
}

