Our function takes $uibModal, $scope, spUtil, $window. We first set our $scope.$on: $scope.$on('record.updated', function(name, data) { c.data.comments = ''; spUtil.update($scope); }) Now, we will handle what happens when the modal window opens: // This function handles opening the modal window.
// If takes the button input and puts it in data object, then reloads the server-side actions.
// After server actions, it opens the modal window. c.openModal = function(button) { c.data.button = button; c.server.update(); c.modalInstance = $uibModal.open({ templateUrl: 'modalTemplate', scope: $scope }); } Remember how, on the HTML, clicking the button executed ng-click="c.openModal(button.name)"? We take that button name, and we pass it to the server as c.data.button = button — this is how our if (input && input.button) works on the server script. On that server script, we set all the stuff needed for our modal window — the label, the text, the commentsVisible, and the commentsMandatory. Next, what happens when the user clicks Submit ? ng-submit="c.uiAction(c.data.button)" occurs, and lets us know, again, which button we’re submitting. // This function handles execution of action per the modal submission.
// It takes the action input and puts it in data object, then reloads the server-side actions.
// After server actions, if there's a referring URL to go to then it goes there.
// If we didn't redirect anywhere, it sets action & button back to undefined and then closes the modal window.
c.uiAction = function(action) { c.data.action = action; c.server.update().then(function() { if (!!c.data.referURL) top.window.location.href = c.data.referURL; c.data.action = undefined; c.data.button = undefined; }) c.modalInstance.close();} We take action on the button by sending c.data.action back to the server — this is what triggers the if (input && input.action). If we provided a referURL, we’d then send the user there — otherwise, we just refresh the page and reset our action and button. Finally, if the user clicks Cancel , we trigger ng-click="c.closeModal()". // This function closes the modal window.
// It first clears out button and action, just in case.
c.closeModal = function() { c.data.action = undefined; c.data.button = undefined; c.modalInstance.close();
} This clears out our action and our button so they can click a different one if they want to instead.

